о лет и знает все тонкости рынка, уверен что с радостью будет делиться своими наработками с вебмастерами.</p> <p><strong class=\"orange\">Женя Каюмов</strong> — владелец cpaclub</p>\";s:2:\"en\";s:613:\"<p>Знаком с Wildo несколько лет, очень известный бро в арбитражной тусовке. Можно смело говорить о его порядочности и надежности как партнера. К тому же Вадим сам работает с wap-click много лет и знает все тонкости рынка, уверен что с радостью будет делиться своими наработками с вебмастерами.</p> <p><strong class=\"orange\">Женя Каюмов</strong> — владелец cpaclub</p>\";}','N;','N;','N;',NULL,'kayumov',0,0,1479982168,1479989438,'a:0:{}',16,1),(115,'a:2:{s:2:\"ru\";s:33:\"Артемий Сибирский\";s:2:\"en\";s:33:\"Артемий Сибирский\";}','a:2:{s:2:\"ru\";s:505:\"<p>С Вадимом давненько знакомы и регулярно общаемся, человек позитивный, ответственный, понятный.  Юзаем некоторые сервисы, где принял участие Вадик - впечатления всегда хорошие! Партнерка, уверен, далеко и высоко пойдет! :)</p><p><strong class=\"blue\">Артемий Сибирский</strong> — арбитражник</p>\";s:2:\"en\";s:505:\"<p>С Вадимом давненько знакомы и регулярно общаемся, человек позитивный, ответственный, понятный.  Юзаем некоторые сервисы, где принял участие Вадик - впечатления всегда хорошие! Партнерка, уверен, далеко и высоко пойдет! :)</p><p><strong class=\"blue\">Артемий Сибирский</strong> — арбитражник</p>\";}','N;','N;','N;',NULL,'sibirskiy',0,0,1479982243,1479989404,'a:0:{}',16,2),(174,'a:2:{s:2:\"ru\";s:18:\"Вконтакте\";s:2:\"en\";s:18:\"Вконтакте\";}','a:2:{s:2:\"ru\";s:0:\"\";s:2:\"en\";s:0:\"\";}','N;','N;','N;',NULL,'vk',0,0,1480058619,1480058638,'a:0:{}',31,1),(176,'a:2:{s:2:\"ru\";s:37:\"Центральная планета\";s:2:\"en\";s:37:\"Центральная планета\";}','a:2:{s:2:\"ru\";s:0:\"\";s:2:\"en\";s:0:\"\";}','N;','N;','N;',NULL,'central_planet',0,0,1480062469,1480064386,'a:0:{}',32,1),(177,'a:2:{s:2:\"ru\";s:11:\"CPAClub.org\";s:2:\"en\";s:11:\"CPAClub.org\";}','a:2:{s:2:\"ru\";s:0:\"\";s:2:\"en\";s:0:\"\";}','N